import React from 'react'

function Navbar() {
    return (
        <div className="nav">
            <img
                className="nav_log"
                src="https://upload.wikimedia.org/wikipedia/commons/0/0f/Logo_Netflix.png"
                alt="Netflix_Logo"
            />



        </div>
    )
}

export default Navbar
